import React from 'react';
import './style.css';
import Sidebar from '../../components/Sidebar';
import Card from '../../components/UI/Card';
import RecentPosts from './RecentPosts';


const SideImage= props=>{
    return(
        <div style={{height:`${props.height}px`}}>
            <img src={props.src} alt=""/>
        </div> 
    );
}
const ImageGallary = props=>(  
    <div className="gallaryPost" style={props.gallaryStyle}>  
    <section style={{width:'70%'}}>
      <div>  
        <img src={require('../../blogPostImages/girl.png')} alt=""/>
      </div> 
    </section>

    <section  className="sideImageWrapper" style={{width:'30%'}}>
        <SideImage height={props.sideImageHeight}
            src={"https://1.bp.blogspot.com/-q2G-P44QbXs/V9_PE1fnC-I/AAAAAAAAD5A/5zt-KGj_SpUZSQwI6DA5ldLYQfC3LvG8wCLcB/s1600/5.jpg"}
        />                
        <SideImage height={props.sideImageHeight}
            src={"https://2.bp.blogspot.com/-ZOY5OAvnKj0/V9_M3_TVTLI/AAAAAAAAD40/UQl4rIoqgi42zaeq0yR_y1gnnchZFxupQCLcB/s1600/3-3.jpg"}
        /> 
        <SideImage height={props.sideImageHeight}
            src={"https://1.bp.blogspot.com/-q2G-P44QbXs/V9_PE1fnC-I/AAAAAAAAD5A/5zt-KGj_SpUZSQwI6DA5ldLYQfC3LvG8wCLcB/s1600/5.jpg"}
        /> 
    </section>
  </div>
        
);

const Home = props=> {
    const gallaryheight=450;
    const gallaryStyle={
        height:gallaryheight+'px',
        overflow:'hidden'
    } 

   const sideImageHeight= gallaryheight/3;

    return(
        <div>
         <Card >
          
         <ImageGallary
            largeWiidth="70%"
            smallWidth="30%"
            sideImageHeight={sideImageHeight}
            gallaryStyle={gallaryStyle}
            // Images=[]
           />
         
         </Card>
            <section className="HomeContainer">
                <RecentPosts style={{width:'70%' }}/>
                <Sidebar/>
            </section>
            
        </div>
    );
}

export default Home;
